import React from 'react';
import './Contact.css';
import PropType from 'prop-types'

function Contact(props){
    return(
        <div className="Contact">

            <img className="avatar" src={props.avatar} alt={props.name + "avatar"}/>
            <div className="status">
                <div className="name">{props.name}</div>
                <div className="status-online status-offline ">
                    <div>
                        {props.status ? <div className="status-online" ><p>ONLINE</p></div>: <div className="status-offline"><p>OFFLINE</p></div>}
                    </div>
                </div>
            </div>

        </div>
    )
}

Contact.prototype = {
    name : PropType.string.isRequired,
    avatar : PropType.string.isRequired,
    online : PropType.bool.isRequired
}
export default Contact;
